import * as types from "../actions/actionTypes";
var initialState = {
  token: ""
};
var myReducer = (state = initialState, action) => {
  switch (action.type) {
    case types.SHOW_PROFILE:
      console.log('dataProfile',action.state)

      return {
        ...action.state
      };

    default:
      return state;
  }
};
export default myReducer;
